    true,nt"url": null,nt"notes": "The dataset consist of acoustic Doppler
    current profiler (ADCP) velocity measurements in the wake of a 3-meter diameter
    vertical-axis hydrokinetic turbine deployed in Roza Canal, Yakima, WA, USA.  A normalized
    hub-centerline wake velocity profile and two cross-section velocity contours, 10
    meters and 20 meters downstream of the turbine, are presented.  Mean velocities
    and turbulence data, measured using acoustic Doppler velocimeter (ADV) at 50 meters
    upstream of the turbine, are also presented. Canal dimensions and hydraulic properties,
    and turbine-related information are also included.n",nt"license_title": "Creative
